FeedPackage.ReleaseNotes:
* Adds new option "ReadOnly" (in addition to Hide and Disable);
      * Supports 'Number' and 'DateTime' formats when comparing (E.g. GreaterThan, even if string, you can now say compare as number);
      * More unit testing on JavaScript methods to cater for more edge cases - stability improved;
      * Incorporates http://www.javascripttoolbox.com/lib/date/ functions;
      * New helper method MvcMegaForms.IsArray for checking if an object is an array

MvcPdfWriter has a  "PdfController" base controller, you must inherit from PdfController. 
e.g. 

  [AllowAnonymous] 
    public class Test1Controller : PdfController 
{ 
[HttpGet] 
public ActionResult TestInvoice(int id) 
{ 
var testModel = new 
{ 
To = "Abc", 
FAO = " test fao", 
RefDate = DateTime.Now.ToShortDateString(), 
Name = "Abc", 
TradingName = "Xyz", 
FunderAddress = "abc road, abc, AB12CD", 
TotalCost = 1000, 
VAT = 200, 
CreditExpiryDate = DateTime.Now.AddMonths(1).ToShortDateString() 
}; 
return ViewPdf(testModel); 
} 

[HttpGet] 
public ActionResult TestInvoice2(int id) 
{ 
var testModel = new 
{ 
To = "Abc", 
FAO = " test fao", 
RefDate = DateTime.Now.ToShortDateString(), 
Name = "Abc", 
TradingName = "Xyz", 
FunderAddress = "abc road, abc, AB12CD", 
TotalCost = 1000, 
VAT = 200, 
CreditExpiryDate = DateTime.Now.AddMonths(1).ToShortDateString() 
}; 
var metadatas = new List<ElementMetadata>{/*your meta data*/}; 
return ViewPdf("c:/Temp/InvoiceTemplate.pdf", metadatas, testModel, "c:/Temp/Output/Invoice-1.pdf"); 
} 
}
